import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
	render() {

		function getFirstName(user) {
			return user.firstName + user.lastName;
		}

		const A = {
			firstName: 'Scott',
			lastName: 'McConnell'
		};

		const B = {
			firstName: 'Joshua',
			lastName: 'France'
		};
		const C = {
			firstName: 'Samir',
			lastName: 'Agadi'
		};

		const hosts = [A,B,C];

		const hostInfo = hosts.map((host) =>
			<div>
				<li className="list-group-item">
					<div className="media">
						<div className="media-body">
							<h5 className="mt-0">{host.firstName}</h5>
							<div className="container">
								<div className="row">
									<div className="col-sm">
										<i className="fas fa-map-marked-alt"></i> {host.firstName}
									</div>
									<div className="col-sm">
										<i className="fas fa-home"></i> {host.firstName}
									</div>
								</div>
								<div className="row">
									<div className="col-sm">
										<i className="fas fa-dollar-sign"></i> .06$/sqInch
									</div>
									<div className="col-sm">
										<i className="fas fa-clock"></i> 8:00AM - 12:00PM (Monday-Friday)
									</div>
								</div>
								<div className="row">
									<div className="col-sm">
										<i className="fas fa-adjust"></i> {host.firstName} sq. ft remaining
									</div>
									<div className="col-sm">
										<i className="fas fa-check-circle"></i> OpenSpace Verified
									</div>
								</div>
							</div>
						</div>
					</div>
				</li>
				<li className="list-group-item">
					{host.firstName}
				</li>
			</div>
		);


		return (
			<div className="App">
				<header className="App-header">
					<div class="col-md-6">
						<ul className="list-group">{hostInfo}</ul>
					</div>			
				</header>
			</div>
		);
	}
}

export default App;
